import React from 'react';
import styled from 'styled-components';
const Card = () => {
  const Background = styled.div`
    background-color: white;
    width: 15rem;
    margin-bottom: 20px;
    padding: 10px;
  `;
  return (
    <>
      <Background></Background>
    </>
  );
};

export default Card;
